import React from "react";

const Form = props => {
	return (
		<form>
			<label>
				Name: {props.name}
				<input type="text" name="name" onChange={props.change} />
			</label>
			<input type="submit" value="Submit" />
			<p>dfssd</p>
		</form>
	);
};

export default Form;

let x = document.getElementById("root");

x.addEventListener("click", () => {
	console.log("normal js works");
});
